AME:"Галамар",UNIT__VALADORN__NAME:"Валадорн",UNIT__DEMON_LORD__NAME:"Демон Лорд",UNIT__SAETH__NAME:"Саеф",UNIT__CRYSTAL__NAME:"Кристалл",UNIT__SAETH_HEAVENS_FURY__NAME:"Саеф",UNIT__SOLDIER__DESCRIPTION:"Солдаты это солидные всесторонние бойцы, которые сформируют костяк любой армии. Также солдаты - единственная единица, которая может захватывать города, приносящие золото.",UNIT__ARCHER__DESCRIPTION:"Со своими мощными луками стрелки могут атаковать на расстоянии и особенно эффективны против летающих врагов.",UNIT__ELEMENTAL__DESCRIPTION:"Элементалы это магические водяные духи. Будучи в воде, Элементалы быстрее передвигаются и лучше защищаются.",UNIT__SORCERESS__DESCRIPTION:"Натасканные в использовании магии, Ведьмы слабы в ближнем бою. Однако, их способность к вызову боевых скелетов из мертвых войск может стать решающей в битве.",UNIT__WISP__DESCRIPTION:"Эти мистические существа чистого света излучают ауру, которая усиливает способности к атаке у ближайших дружественных единиц. В ближнем бою они особенно смертельны против скелетов.",UNIT__DIRE_WOLF__DESCRIPTION:"Жуткие Волки - опасные охотники, которые передвигаются стаями. Будьте осторожны - их укусы ядовиты, что уменьшает и атаку, и защиту на один ход.",UNIT__GOLEM__DESCRIPTION:"Големы - это древние существа - медленны, но необычайно сильны в защите. Голема, расположенного в здании или хорошо защищенной горе очень сложно победить.",UNIT__CATAPULT__DESCRIPTION:"Катапульты приносят опустошение везде, куда достанут со своей гигантской зоной атаки. Однако, они относительная неподвижность и неспособность атаковать вблизи делают их уязвимыми, так что защищайте их хорошо. Катапульты могут передвигаться и атаковать в течении хода, но только что-нибудь одно за ход.",UNIT__DRAGON__DESCRIPTION:"Эти грациозные летающие твари правят над горами с древнейших времен. Они чрезвычайно подвижны, а так же смертельно опасны в атаках на земле, воздухе и в море.",UNIT__SKELETON__DESCRIPTION:"Вызванные ведьмами, эти безжизненные воины сильны как солдаты и смертельные оппоненты на любом поле боя.",UNIT__GALAMAR__DESCRIPTION:"Галамар (командир) очень силен в атаке и защите. Командиры могут также занимать замки, чтобы производить войска, и их можно оживлять в замке, если они умрут в битве.",UNIT__VALADORN__DESCRIPTION:"Валадорн (командир) очень силен в атаке и защите. Командиры могут также занимать замки, чтобы производить войска, и их можно оживлять в замке, если они умрут в битве.",UNIT__DEMON_LORD__DESCRIPTION:"Демон лорд (командир) очень силен в атаке и защите. Командиры могут также занимать замки, чтобы производить войска, и их можно оживлять в замке, если они умрут в битве.",UNIT__SAETH__DESCRIPTION:"Саеф (командир) очень силен в атаке и защите. Командиры могут также занимать замки, чтобы производить войска, и их можно оживлять в замке, если они умрут в битве.",UNIT__CRYSTAL__DESCRIPTION:"Эти легендарные кристаллы были изначально выкопаны из руин Античной Цитадели. Мало что известно об их силе, за исключением того, что они, по слухам, могут защитить королевство, а также обладают силой, чтобы уничтожить его.",UI__BUTTON__PLAY:"Играть",UI__BUTTON__SETTINGS:"Настройки",UI__BUTTON__MAP_EDITOR:"Редактор карт",UI__BUTTON__INSTRUCTIONS:"Инструкции",UI__BUTTON__ABOUT:"О программе",UI__BUTTON__COMPANIES:"Компании",UI__BUTTON__LOAD_GAME:"Загрузить игру",UI__BUTTON__SKIRMISH:"Схватка",UI__BUTTON__USER_MAPS:"Свои карты",UI__BUTTON__MISSION:"Миссия",SETUP_SKIRMISH__PLAYER:"Игрок",SETUP_SKIRMISH__BOT:"Бот",SETUP_SKIRMISH__NONE:"Нет",SETUP_SKIRMISH__TEAM:"Команда {number}",SETUP_SKIRMISH__MONEY:"Деньги",SETUP_SKIRMISH__UNIT_LIMIT:"Лимит войск",SETUP_SKIRMISH__FIGHT:"В бой!",GAME__END_TURN:"Конец хода",GAME__REVERT_MOVE:"Вернуться назад",NOTIFICATION__OBJECTIVE:"Цель",NOTIFICATION__SKIRMISH_OBJECTIVE:"Поразить вражеского командира и захватить все вражеские замки!",NOTIFICATION__INCOME:"Доход: {income}",NOTIFICATION__REDS__FIGHT:"Красные! В бой!",NOTIFICATION__BLUES__FIGHT:"Синие! В бой!",NOTIFICATION__BLACKS__FI